import './Player.css'

const Player = ({name, surname, number, position, photo}) => {
    const altText = `${name} ${surname} — ${position} — number ${number}`
    return (
      <article className='player' aria-label={`${name} ${surname}`}>
        <img src={photo} alt={altText} loading="lazy" />
        <h2>{name} {surname}</h2>
        <p>Number: {number}</p>
        <p>{position}</p>
      </article>
    )
  }

export default Player
